import React, { Component } from "react";
import { Cell } from "./Cell";
class GameBoard extends Component {
  constructor(props) {
    super(props);

    this.state = { column: [] };
    console.log(props);
  }

  componentWillMount() {
    this.setState({
      columns: this.props.columns
    });
    console.log(this.props);
  }

  renderCells() {
    return this.state.columns.map(column => (
      <div>
        <Cell key={column} text={column} />
      </div>
    ));
  }

  render() {
    return <div className="gameBoard">{this.renderCells()}</div>;
  }
}

export { GameBoard };
